import {Container} from './styles'
import Input from '../components/Input';
import gitlogo from '../assets/gitx.png'
import ItemRepo from '../components/itemRepo';
function App() {
  return (



    <Container>
    <img src={gitlogo} width={72} height={72} alt='icone'/>
    <Input/>
    <ItemRepo/>
    </Container>




  );
}

export default App;
